import { useSelector } from "react-redux";


const Users = () => {

    const user = useSelector((state) => state.userReducer);
    const users = useSelector((state) => state.usersReducers);



  return (
    <div>
      Users: {user.name}
      <ul>
        {users.map((u) => (
          <li key={u.name}>{u.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default Users;
